-- MODIFICAR TABLA FUNCIONARIO, ADICIONAR LDAUP_USER
ALTER TABLE FLDADMIN.FUNCIONARIO
ADD LDAP_USER VARCHAR2(100 BYTE);

-- REALIZA LA ACTUALIZACION DEL LDAP_USER DE AQUELLOS FUNCIONARIOS QUE FUERON RELACIONADOS
UPDATE  FLDADMIN.FUNCIONARIO FN 
set FN.LDAP_USER = ( SELECT LD.LDAP_USER FROM  FLDADMIN.TEMP_LDAP LD WHERE LD.DOCUMENTO=FN.IDENTIFICACION AND LD.DOCUMENTO IS NOT NULL AND ESTADO='Habilitado' AND LD.LDAP_USER IS NOT NULL AND ROWNUM <=1 )
WHERE FN.IDENTIFICACION IN ( SELECT LDA.DOCUMENTO FROM  FLDADMIN.TEMP_LDAP LDA WHERE LDA.DOCUMENTO IS NOT NULL)
AND FN.IDENTIFICACION IS NOT NULL;
COMMIT;

-- BORRA LA TABLA TEMPORAL
 DROP TABLE "FLDADMIN"."TEMP_LDAP" ;
